define('app/page/account',[], function () {
    var model = { facebook : {},
      fields : ["first_name", "last_name", "email", "birthday", "relationship_status", "location"]
    };

    function loadMe(data){
      if (!data) return;
      var keys = model.fields;
      var html = "<table class=\"u-full-width\"><tr><th>Key</th><th>Value</th><tr>";
      function addKeyValuePair(key, value){
        var keyName = key.substr(0,1).toUpperCase() + key.substr(1).replace(/_/g, " ");
        var valueName = (typeof value == "string" ? value : value.name);
        html += "<tr><td>" + keyName  + "</td><td>" + valueName + "</td></tr>";
      }
      var key, val;
      for(var k in keys){
        key = keys[k];
        val = data[key];
        if(val){
          addKeyValuePair(key, val);
        }
      }
      key = "significant_other";
      val = data[key];
      if(val && val.name){
        addKeyValuePair(key, val.name);
      }
      $("#primary").html(html + "</table>");
    }

    function loadResponse(response, template){
      if (!(response && response.data &&  response.data.length)){
        return;
      }
      var html ="<div class=\"row\">";
      var count = 0;
      var total = 0;
      for(var i in response.data) {
        var item = response.data[i];

        if (item && item[template.key]) {
          html += template.append(item[template.key]);
          count++;
          total++;
          if (!(count < 6)){
            count = 0;
            html += template.delimeter;
          }
        }
      }
      var mainId = "#" + template.title.toLowerCase();
      $(mainId+"-count").html(template.title + ": " + total);
      $(mainId).html("<div class=\"twelve columns\"><h3><a name=\""+
      mainId + "\"></a>"+

      template.title +
      "</h3></div>" +
      html + "</div>");
    }

    function loadPhotos(response) {
      loadResponse(response, {
        title : "Photos",
        delimeter : "</div><div class=\"row\">",
        key:"picture",
        append: function(x){
          return "<div class=\"col-sm-2\"><img class=\"center\" src=\"" + x + "\"/></div>"
        }
      });
    }
    function loadFamily(response){
      loadResponse(response, {
        title : "Family",
        delimeter : "",
        key: "name",
        append: function(x){
          return  x + ", ";
        }
      });
    }
    function loadLikes(response){
      loadResponse(response, {
        title : "Likes",
        delimeter : "",
        key: "name",
        append: function(x){
          return  x + ", ";
        }
      });
    }
    function loadLocation(){


    }
    function loadAccount(){
      var fields = model.fields[0];
      for(var i =1; i < model.fields.length;i++){
        fields +="," + model.fields[i]
      }
      model.facebook.api("/me?fields=" + fields, loadMe);
      model.facebook.api("/me/photos?type=uploaded", loadPhotos);
      model.facebook.api("/me/photos?type=uploaded", loadPhotos);
      model.facebook.api("/me/likes", loadLikes);
      model.facebook.api("/me/family", loadFamily);
    }

    function load (/*args*/) {
      model.facebook = window.FB;
      model.facebook.getLoginStatus(function(response){
        if(response && response.status && response.status === "connected"){
          loadAccount();
        }
      });
  };
  return load;
});

define('app/page/global',[], function () {
    var model = { facebook : {} };

    function showLoggedIn(){
        var loggedIn = true;
        $("[data-logged="+!loggedIn+"]").addClass("hidden");
        $("[data-logged="+loggedIn+"]").removeClass("hidden");
        model.facebook.api('/me', function (response) {
            $("#welcome").html("Hi " + response.first_name);
        });
    }

    function showLoggedOut(){
        var loggedIn = false;
        $("[data-logged="+!loggedIn+"]").addClass("hidden");
        $("[data-logged="+loggedIn+"]").removeClass("hidden");
    }

    function load() {
        model.facebook = window.FB;
        //$("head").append("<link rel=stylesheet href=/assets/styles.min.css>");

        model.facebook.getLoginStatus(function (response) {
          if(response && response.status && response.status === "connected"){
            showLoggedIn();
          }
          else{
            showLoggedOut();
          }
        });

        // Login
        $(".login").click(function(){
            model.facebook.login(function(){window.location.reload()},
              { scope: 'public_profile,email,user_birthday,user_location,user_likes,user_friends,user_relationships,user_photos' });
        });

        // Logout
        $(".logout").click(function(){
            model.facebook.logout(function(){window.location.reload()});
        });
    };
    return load;
});

define('app/page/japanese',[], function () {
    var model =
    {
        hiragana :{
            "": "a",  "": "i",  "": "u", "": "e", "": "o",
            "": "ka", "": "ki", "": "ku", "": "ke", "": "ko",
            "": "sa", "": "shi", "": "su", "": "se", "": "so",
            "": "ta", "": "tsu", "": "tsu", "": "te", "": "to",
            "": "na", "": "ni",  "": "nu", "": "ne", "": "no",
            "": "ha", "": "hi",  "": "hu", "": "he", "": "no",
            "": "ma", "": "mi",  "": "mu", "": "me", "": "mo",
            "": "ya",             "": "yu",             "": "yo",
            "": "ra", "": "ri",  "": "ru", "": "re", "": "ro",
            "": "wa", "": "wi",             "": "we", "": "wo",
            "": "n",
            "":"ga", "":"gi", "":"gu", "":"ge", "":"go",
            "":"za","":"ji","":"zu","":"ze","":"zo",
            "":"da", "":"ji", "":"zu", "":"de", "":"do",
            "":"ba", "":"bi", "":"bu", "":"be", "":"bo",
            "":"pa", "":"pi", "":"pu", "":"pe", "":"po",
            "": "vu"
        },
        katakana :{
            "": "a",  "": "i",  "": "u", "": "e", "": "o",
            "": "ka", "": "ki", "": "ku", "": "ke", "": "ko",
            "": "sa", "": "shi", "": "su", "": "se", "": "so",
            "": "ta", "": "tsu", "": "tsu", "": "te", "": "to",
            "": "na", "": "ni",  "": "nu", "": "ne", "": "no",
            "": "ha", "": "hi",  "": "hu", "": "he", "": "no",
            "": "ma", "": "mi",  "": "mu", "": "me", "": "mo",
            "": "ya",             "": "yu",             "": "yo",
            "": "ra", "": "ri",  "": "ru", "": "re", "": "ro",
            "": "wa", "": "wi",             "": "we", "": "wo",
            "": "n",
            "":"ga", "":"gi", "":"gu", "":"ge", "":"go",
            "":"za","":"ji","":"zu","":"ze","":"zo",
            "":"da", "":"ji", "":"zu", "":"de", "":"do",
            "":"ba", "":"bi", "":"bu", "":"be", "":"bo",
            "":"pa", "":"pi", "":"pu", "":"pe", "":"po"
        }
    }

    function load (args) {
        var lines = $(".japanese .col-sm-4");
        for(var l = 0; l < lines.length; l+=3){
            var src = $(lines[l+0]).html();
            var rom = $(lines[l+1]).html();
            var romLower = rom.toLowerCase();
            var newSrc = "";
            var newRom = "";
            var previousIndex = 0;
            for(var i = 0; i < src.length; i++){

                var dictionary;
                var lookup;
                var dictionries = ["hiragana", "katakana"];
                for(var d = 0; d < dictionries.length; d++){
                    dictionary = dictionries[d];
                    lookup = model[dictionary][src[i]];
                    if (lookup) {
                        break;
                    }
                }

                if (lookup){
                    var tagOpen = "<span class=\"ja " + dictionary + " char-" + lookup[lookup.length-1] + "\">";
                    var tagClose = "</span>";
                    newSrc += tagOpen + src[i] + tagClose
                    var lookupIndex = romLower.indexOf(lookup, previousIndex);
                    if (lookupIndex > -1) {
                        newRom += rom.substr(previousIndex, lookupIndex - previousIndex)
                        + tagOpen
                        + rom.substr(lookupIndex, lookup.length)
                        + tagClose;
                        previousIndex = lookupIndex + lookup.length;
                    }
                }
                else{
                    newSrc += src[i];
                }
            }
            newRom += rom.substr(previousIndex);

            $(lines[l+0]).html(newSrc);
            $(lines[l+1]).html(newRom);
        }

    };
    return load;
});

